import { NavLink } from "react-router-dom";
import { AppBar, Button, Toolbar } from "@mui/material";

export default function Main(){
    return(
        <AppBar position="sticky">
            <Toolbar>
                <Button component={Link} to='/product' color="inherit"></Button>
                <Button component={Link} to='/employee' color="inherit"></Button>
            </Toolbar>
        </AppBar>
    )
}
